content:
Ai còn nhớ về nàng Bạch Tuyết này điểm danh .
Loạt phim hoạt hình 52 tập The Legend of Snow White (Truyền thuyết về Bạch Tuyết) do Nhật Bản sản xuất được chiếu trên đài truyền hình NHK vào tháng 4 năm 1994, sau đó cũng được đài truyền hình Việt Nam mua bản quyền . Mình nhớ phim được chiếu vào tầm 5 hay 6 giờ chiều trên kênh vtv3 hồi năm 2000 thì phải (lâu quá không nhớ nổi
)
Phim lấy bộ khung câu chuyện cổ tích gốc về nàng Bạch Tuyết "da trắng như tuyết, môi đỏ như máu và tóc đen như gỗ mun"(tất nhiên rồi
), tuy nhiên câu chuyện được các nhà biên kịch Nhật Bản xây dựng theo hướng Fantasy, nhồi vào đủ thứ hầm bà lằn như Tiên tộc, vương quốc người lùn , quân đội Orc ....đến mức người viết khá chắc rằng đội ngũ biên kịch hẳn là fan cuồng của Chúa Nhẫn.
